const Routines = async (props) => {

    const {
        setRoutines,
        routines
    } = props;

  await fetch('http://fitnesstrac-kr.herokuapp.com/api/routines', {
     headers: {
     'Content-Type': 'application/json',
     },
    }).then(response => response.json())
    .then(result => {
        console.log(result);
        setRoutines(result);
    })
  .catch(console.error);




    return (
        <div className='publicRoutines'>
            <h1>Fitness Routines</h1>
            {routines ? routines.map((routine, index) => <Routine key={index} routine={routine} /> ) : null }
         </div>
    )
}



export default Routines;
